import React from "react";

const PlayersForm = () => {
  return (
    <>
      <form className="player-form">
        <label>
          Player 1 name :
          <input type="text" />
        </label>
        <label>
          Player 2 name :
          <input type="text" />
        </label>
        <button type="submit"></button>
      </form>
    </>
  );
};

export default PlayersForm;
